  return (
    <div>
      <Box
        sx={{
          display: 'grid',
          gridAutoColumns: '1fr',
          gap: 1,
        }}
      >
        <Button sx={{ gridRow: '1', gridColumn: 'span 2' }}>span 2</Button>
        {/* The second non-visible column has width of 1/4 */}
        <Button sx={{ gridRow: '1', gridColumn: '4 / 5' }}>4 / 5</Button>
      </Box>
    </div>
  );
}
